import React from "react";
import Item from "./Items";
const usersNames = ["Winnie", "Bob", "Thomas", "George"];

export default function List({ blocktext, id }) {
  return (
    <div className="container">
      {blocktext.map(
        (v, i, arr) => (
          console.log(i),
          (
            <div>
              <h3
                className={
                  (i === 0 && "user1 users") ||
                  (i === 1 && "user2 users") ||
                  (i === 2 && "user3 users") ||
                  (i === 3 && "user4 users")
                }
              >
                {usersNames[i]}
              </h3>
              {arr[i].map((v, i, arr) => (
                <Item text={arr[i]} />
              ))}
              <button class="end">+ Add a card</button>
            </div>
          )
        )
      )}
    </div>
  );
}
